import React from "react";
import Head from "./header";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Home from "./body";
import About from "./about";

function App() {
  return (
    <div>
     <Router>
        <Switch>
          <Route path="/aboutus">
            <About/>
          </Route>
          <Route path="/">
            {/* <Temporary/> */}
            <Home/>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
